import React, { useEffect, useState } from 'react'
import './Home.scss'
import axios from 'axios';
import { useDispatch, useSelector } from 'react-redux';
import { GetContact } from '../../api/GetContact';
import { ContactDetailModelType, ContactModelType } from '../../models/ContactModel';
import { withStyles, Theme, createStyles, makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import { defaultAvatar } from '../../helpers/defaultAvatar';
import { useParams } from 'react-router';

const EditContact = () => {
    const { id }: any = useParams();
    const [ contactList, setContactList ] = useState([] as ContactDetailModelType[])
    const [ isToggleMenu, setIsToggleMenu ] = useState(false);


    useEffect(()=>{
        getContact()
    },[])

    const getContact = () => {
        GetContact().then((result) => {
            setContactList(result)
            console.log(result, 'apani')
        })
    }

    const toggleMenu = () => {
        setIsToggleMenu(!isToggleMenu);
    }


    //Table Styling
    const StyledTableCell = withStyles((theme: Theme) =>
        createStyles({
            head: {
                backgroundColor: theme.palette.common.black,
                color: theme.palette.common.white,
            },
            body: {
                fontSize: 14,
            },
        }),
    )(TableCell);

    const StyledTableRow = withStyles((theme: Theme) =>
        createStyles({
            root: {
            '&:nth-of-type(odd)': {
                backgroundColor: theme.palette.action.hover,
            },
            },
        }),
    )(TableRow);

    const useStyles = makeStyles({
        table: {
          minWidth: 700,
        },
      });

      const classes = useStyles();
    return (
        <div className="contact-home">
            <div className={`menu-bar ${isToggleMenu ? 'show' : ''}`} >
                <div className="menu-header">
                    <div className="logo">
                        <img src="https://1.bp.blogspot.com/-KfCsyDWCa90/YHl1dr74s6I/AAAAAAAAEvE/Tc9vt0TdZjcm9161h0wGqt6Ns9QSH4kegCLcBGAsYHQ/s1600/Logo%2BDogecoin.png" style={{width: '120px'}}/>
                    </div>
                    <div className="toggle" onClick={toggleMenu}>
                        X
                    </div>
                </div>
                <div className="menu-item">
                    All Contact List
                </div>
                <div className="menu-item">
                    My Contact
                </div>
                <div className="menu-item">
                    About
                </div>
            </div>
            <div className="contact-main">
                <div className="header">
                    Selamat datang
                </div>
                <div className="contact-table">
                    <TableContainer component={Paper}>
                        <Table className={classes.table} aria-label="customized table">
                            <TableHead>
                                <TableRow>
                                    <StyledTableCell align="left">Profile Picture</StyledTableCell>
                                    <StyledTableCell align="left">First Name</StyledTableCell>
                                    <StyledTableCell align="left">Last Name</StyledTableCell>
                                    <StyledTableCell align="left">Age</StyledTableCell>
                                    <StyledTableCell align="center" colSpan={2}>Action</StyledTableCell>
                                </TableRow>
                            </TableHead>
                            <TableBody>
                            {contactList.map((res) => (
                                <StyledTableRow key={res.id}>
                                    <StyledTableCell align="left">
                                        <img src={defaultAvatar(res.photo)} alt="photo" style={{width: '50px', height: '50px'}} />
                                    </StyledTableCell>
                                    <StyledTableCell align="left">{res.firstName}</StyledTableCell>
                                    <StyledTableCell align="left">{res.lastName}</StyledTableCell>
                                    <StyledTableCell align="left">{res.age}</StyledTableCell>
                                    <StyledTableCell align="center">
                                        <button className="button-edit">Edit</button>
                                    </StyledTableCell>
                                    <StyledTableCell align="center">
                                        <button className="button-delete">Remove</button>
                                    </StyledTableCell>
                                </StyledTableRow>
                            ))}
                            </TableBody>
                        </Table>
                    </TableContainer>
                </div>
            </div>

            {
                contactList.map((res) => {
                    return (
                        <div className="contact-list">
                            {/* {res.age} */}
                        </div>
                    )
                })
            }
        </div>
    )
}

export default EditContact;
